import GlobalStyles from "./components/Reset";
import { Link } from "react-router-dom";
import { Outlet } from "react-router-dom";
import styled from "styled-components";
import Header from "./components/Header";
import Footer from "./components/Footer";
import LogoIMG from "./img/new_logo_nobackground.png";
{
  /*백엔드 상의 후 이미지 처리 어디에 넣을지 상의*/
}
const Page = styled.div`
  width: 100vw;
  height: 100vh;
  position: relative;
`;
const LogoContainer = styled.div`
  width: 15rem;
  height: 15rem;
  min-height: 200px;
  z-index: 99;
  border: 1px solid var(--border);
  border-radius: 50%;
  position: absolute;
  left: 50%;
  bottom: 0;
  transform: translate(-50%, 10%);
  background-color: white;
  display: flex;
  justify-content: center;
  align-items: center;
`;
const MainLogo = styled.img`
  width: 190px;
  height: 190px;
  &:hover {
    transform: scale(1.2);
  }
`;
function App() {
  return (
    <Page>
      <Header />
      <GlobalStyles />
      <Outlet />
      <Footer />
      <LogoContainer>
        <Link to={"/"} id="Logo">
          <MainLogo src={LogoIMG} alt="Main Logo" />
        </Link>
      </LogoContainer>
    </Page>
  );
}

export default App;
